dg_read_field_def_SC_login(<<1:1, X:7, Rest/binary>>, N, Acc, F, F@_1, TrUserData) when N < 32 - 7 -> dg_read_field_def_SC_login(Rest, N + 7, X bsl N + Acc, F, F@_1, TrUserData);
