read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) -> merge_msgs(Prev, New, MsgName, []).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      'CS_server_info' -> merge_msg_CS_server_info(Prev, New, TrUserData);
      'SC_server_info' -> merge_msg_SC_server_info(Prev, New, TrUserData);
      'CS_user' -> merge_msg_CS_user(Prev, New, TrUserData);
      'SC_user.User' -> 'merge_msg_SC_user.User'(Prev, New, TrUserData);
      'SC_user' -> merge_msg_SC_user(Prev, New, TrUserData);
      'CS_login' -> merge_msg_CS_login(Prev, New, TrUserData);
      'SC_login' -> merge_msg_SC_login(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_CS_server_info/3}).
merge_msg_CS_server_info(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,merge_msg_SC_server_info/3}).
merge_msg_SC_server_info(PMsg, NMsg, _) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
	   {_, #{server := NFserver}} -> S1#{server => NFserver};
	   {#{server := PFserver}, _} -> S1#{server => PFserver};
	   _ -> S1
	 end,
    S3 = case {PMsg, NMsg} of
	   {_, #{status := NFstatus}} -> S2#{status => NFstatus};
	   {#{status := PFstatus}, _} -> S2#{status => PFstatus};
	   _ -> S2
	 end,
    case {PMsg, NMsg} of
      {_, #{open_date := NFopen_date}} -> S3#{open_date => NFopen_date};
      {#{open_date := PFopen_date}, _} -> S3#{open_date => PFopen_date};
      _ -> S3
    end.

-compile({nowarn_unused_function,merge_msg_CS_user/3}).
merge_msg_CS_user(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
      {_, #{uid := NFuid}} -> S1#{uid => NFuid};
      {#{uid := PFuid}, _} -> S1#{uid => PFuid};
      _ -> S1
    end.

-compile({nowarn_unused_function,'merge_msg_SC_user.User'/3}).
'merge_msg_SC_user.User'(PMsg, NMsg, _) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
	   {_, #{server := NFserver}} -> S1#{server => NFserver};
	   {#{server := PFserver}, _} -> S1#{server => PFserver};
	   _ -> S1
	 end,
    case {PMsg, NMsg} of
      {_, #{rid := NFrid}} -> S2#{rid => NFrid};
      {#{rid := PFrid}, _} -> S2#{rid => PFrid};
      _ -> S2
    end.

-compile({nowarn_unused_function,merge_msg_SC_user/3}).
merge_msg_SC_user(PMsg, NMsg, TrUserData) ->
    S1 = #{},
    case {PMsg, NMsg} of
      {#{user := PFuser}, #{user := NFuser}} -> S1#{user => 'erlang_++'(PFuser, NFuser, TrUserData)};
      {_, #{user := NFuser}} -> S1#{user => NFuser};
      {#{user := PFuser}, _} -> S1#{user => PFuser};
      {_, _} -> S1
    end.

-compile({nowarn_unused_function,merge_msg_CS_login/3}).
merge_msg_CS_login(PMsg, NMsg, _) ->
    S1 = #{},
    S2 = case {PMsg, NMsg} of
	   {_, #{uid := NFuid}} -> S1#{uid => NFuid};
	   {#{uid := PFuid}, _} -> S1#{uid => PFuid};
	   _ -> S1
	 end,
    S3 = case {PMsg, NMsg} of
	   {_, #{server := NFserver}} -> S2#{server => NFserver};
	   {#{server := PFserver}, _} -> S2#{server => PFserver};
	   _ -> S2
	 end,
    S4 = case {PMsg, NMsg} of
	   {_, #{info := NFinfo}} -> S3#{info => NFinfo};
	   {#{info := PFinfo}, _} -> S3#{info => PFinfo};
	   _ -> S3
	 end,
    case {PMsg, NMsg} of
      {_, #{sign := NFsign}} -> S4#{sign => NFsign};
      {#{sign := PFsign}, _} -> S4#{sign => PFsign};
      _ -> S4
    end.

-compile({nowarn_unused_function,merge_msg_SC_login/3}).
merge_msg_SC_login(PMsg, NMsg, _) ->
    S1 = #{},
    case {PMsg, NMsg} of
      {_, #{code := NFcode}} -> S1#{code => NFcode};
      {#{code := PFcode}, _} -> S1#{code => PFcode};
      _ -> S1
    end.


verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      'CS_server_info' -> v_msg_CS_server_info(Msg, [MsgName], TrUserData);
      'SC_server_info' -> v_msg_SC_server_info(Msg, [MsgName], TrUserData);
      'CS_user' -> v_msg_CS_user(Msg, [MsgName], TrUserData);
      'SC_user.User' -> 'v_msg_SC_user.User'(Msg, [MsgName], TrUserData);
      'SC_user' -> v_msg_SC_user(Msg, [MsgName], TrUserData);
      'CS_login' -> v_msg_CS_login(Msg, [MsgName], TrUserData);
      'SC_login' -> v_msg_SC_login(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


