-dialyzer({nowarn_function,v_msg_CS_server_info/3}).
v_msg_CS_server_info(#{} = M, Path, _) -> lists:foreach(fun (OtherKey) -> mk_type_error({extraneous_key, OtherKey}, M, Path) end, maps:keys(M)), ok;
v_msg_CS_server_info(M, Path, _TrUserData) when is_map(M) -> mk_type_error({missing_fields, [] -- maps:keys(M), 'CS_server_info'}, M, Path);
