    case M of
      #{server := F1} -> v_type_int32(F1, [server | Path], TrUserData);
      _ -> ok
    end,
    case M of
      #{status := F2} -> v_type_int32(F2, [status | Path], TrUserData);
      _ -> ok
    end,
    case M of
      #{open_date := F3} -> v_type_string(F3, [open_date | Path], TrUserData);
      _ -> ok
    end,
    lists:foreach(fun (server) -> ok;
		      (status) -> ok;
		      (open_date) -> ok;
		      (OtherKey) -> mk_type_error({extraneous_key, OtherKey}, M, Path)
		  end,
		  maps:keys(M)),
    ok;
